import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './signUp.css';
import videobg from '../../../assets/react-bg.mp4';
import logo from '../../../assets/Fin-map-2.png';

function SignUp() {
    const [formData, setFormData] = useState({
        name: '',
        email: '',
        password: '',
        confirmPassword: ''
    });

    const navigate = useNavigate();

    const handleChange = (e) => {
        setFormData({
            ...formData,
            [e.target.name]: e.target.value
        });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        // console.log(formData);
        if (formData.password !== formData.confirmPassword) {
            alert('Passwords do not match');
            return;
        }
        console.log('Form submitted');

        setFormData({
            FirstName: '',
            LastName: '',
            email: '',
            password: '',
            confirmPassword: ''
        });
        navigate('/login');
    };
    const navigateToAboutUs = () => {
        window.location.href = '/about';
    };

    return (
        <>
            <div className='page-logo'>
                <image src={logo} alt />
            </div>
            <di classname="overlay">
                <video src={videobg} autoPlay loop muted />
            </di>
            <div className='signup-container'>

                <form onSubmit={handleSubmit}>
                    <h2>Sign Up</h2>
                    <div className='form-group'>
                        <label htmlFor="name">First Name</label>
                        <input
                            type="text"
                            placeholder='First Name'
                            name="name"
                            value={formData.FirstName}
                            onChange={handleChange}
                            required
                        />
                    </div>
                    <div className='form-group'>
                        <label htmlFor="name">Last Name</label>
                        <input
                            type="text"
                            placeholder='Last Name'
                            name="name"
                            value={formData.LastName}
                            onChange={handleChange}
                            required
                        />
                    </div>
                    <div className='form-group'>
                        <label htmlFor="email">Email</label>
                        <input
                            type="email"
                            placeholder='eg.finmap@gmail.com'
                            name="email"
                            value={formData.email}
                            onChange={handleChange}
                            required
                        />
                    </div>
                    <div className='form-group'>
                        <label htmlFor="password"></label>
                        <input
                            type="password"
                            placeholder='Password'
                            name="password"
                            value={formData.password}
                            onChange={handleChange}
                            required
                        />
                    </div>
                    <div className='form-group'>
                        <label htmlFor="confirmPassword"></label>
                        <input
                            type="password"
                            placeholder='Confirm Password'
                            name="confirmPassword"
                            value={formData.confirmPassword}
                            onChange={handleChange}
                            required
                        />
                    </div>
                    <button type="submit">Sign Up</button>
                    <p className='login-link'>Already have an account? <a href='./logIn' _blank>Log In</a></p>
                </form>
            </div>
            <nav className='about-btn'>
                <button onClick={navigateToAboutUs}>About Us</button>
            </nav>
        </>
    );
}

export default SignUp;
